          "id": "b4018d794fd5b2c2f54541102c7625ffd900f26f",
          "message": "feat(proto): add getbudgets rpc for unified budget visibility (#149)\n\nEnables FinOps engineers to view budgets from multiple cloud providers (AWS\nBudgets, GCP Billing Budgets, Azure Cost Management, Kubecost) in a single\nunified output. Implements optional RPC pattern allowing plugins to return\nUnimplemented if they don't support budget functionality. Includes comprehensive\ntesting with conformance, integration, performance benchmarks (100-1000 budgets),\nand schema validation for budget request examples.\n\n- [x] `make lint` passes with zero issues\n- [x] `make test` passes - all tests including budget and multi-provider tests\n- [x] `make validate` passes - all schema validations successful\n- [x] GetBudgets RPC conformance test validates optional RPC behavior\n- [x] Cross-provider budget mapping test validates AWS/GCP unified structures\n- [x] Multi-provider support test validates Supports/GetProjectedCost/GetPricingSpec\n- [x] Performance benchmarks validate <5s latency for 100-1000 budgets\n- [x] Budget request schema validation added to validate_examples.js\n\n- `proto/pulumicost/v1/budget.proto` - Budget message definitions\n- `schemas/budget_spec.schema.json` - JSON schema for budget requests\n- `examples/budgets/*.json` - Budget examples (AWS, GCP, Kubecost)\n- `examples/requests/get-budgets-*.json` - Request examples\n- `specs/001-get-budgets-rpc/` - Feature specification documents\n\n- `proto/pulumicost/v1/costsource.proto` - Added GetBudgets RPC method\n- `sdk/go/pluginsdk/sdk.go` - Added BudgetsProvider interface\n- `sdk/go/testing/harness.go` - Added ValidateBudgetsResponse function\n- `sdk/go/testing/mock_plugin.go` - Added MockBudgets support\n- `sdk/go/testing/integration_test.go` - Added budget and multi-provider tests\n- `sdk/go/testing/benchmark_test.go` - Added budget performance benchmarks\n- `sdk/go/testing/rpc_correctness.go` - Added GetBudgets RPC correctness tests\n- `validate_examples.js` - Added budget schema validation\n- `PLUGIN_DEVELOPER_GUIDE.md` - Updated with GetBudgets documentation\n\nCloses #123",
