          "id": "ef71ba6018169b630f3068deab45b97bd1e3522c",
          "message": "feat(pluginsdk): add request validation helpers (#151)\n\n* feat(pluginsdk): add request validation helpers\n\n## Summary\n\nAdds shared validation helpers for `GetProjectedCostRequest` and\n`GetActualCostRequest` that both pulumicost-core and plugins can use.\nThese functions provide pre-flight validation with actionable error\nmessages that reference the mapping helper functions, helping developers\nquickly diagnose and fix configuration issues.\n\nKey design decisions:\n\n- Exported sentinel errors enable type-safe `errors.Is()` checking\n- Zero-allocation design meets <100ns performance requirement\n- Error messages include guidance like \"use mapping.ExtractAWSSKU\"\n- Fail-fast validation order: nil checks first, then field validation\n\n## Test plan\n\n- [x] `make test` passes - all validation tests pass\n- [x] `make lint` passes for Go code (0 issues)\n- [x] Benchmarks confirm zero allocations and <100ns performance\n- [x] Table-driven tests cover all edge cases\n- [x] Test/code ratio: 2.64x (310 test lines / 117 code lines)\n\n## Changes\n\n### New files\n\n- `sdk/go/pluginsdk/validation.go` - Validation functions and sentinel\n  errors for ProjectedCost and ActualCost requests\n- `sdk/go/pluginsdk/validation_test.go` - Comprehensive tests and\n  benchmarks for validation functions\n\n### Modified files\n\n- `sdk/go/testing/contract.go` - Removed unused nolint directive,\n  updated `interface{}` to `any`\n- `sdk/go/testing/contract_test.go` - Added benchmark, updated loop\n  syntax to Go 1.22+ style\n\n### Housekeeping\n\n- `specs/017-pluginsdk-validation/tasks.md` - Marked all tasks complete\n\nCloses #130\n\n* feat(pluginsdk): add request validation helpers\n\nAdds shared validation helpers for `GetProjectedCostRequest` and\n`GetActualCostRequest` that both pulumicost-core and plugins can use.\nThese functions provide pre-flight validation with actionable error\nmessages that reference the mapping helper functions, helping developers\nquickly diagnose and fix configuration issues.\n\nKey design decisions:\n\n- Exported sentinel errors enable type-safe `errors.Is()` checking\n- Zero-allocation design meets <100ns performance requirement\n- Error messages include guidance like \"use mapping.ExtractAWSSKU\"\n- Fail-fast validation order: nil checks first, then field validation\n- Comprehensive package documentation explains design philosophy\n\n- [x] `make test` passes - all validation tests pass\n- [x] `make lint` passes for Go code (0 issues)\n- [x] `make lint-markdown` passes (0 errors)\n- [x] Benchmarks confirm zero allocations and <100ns performance\n- [x] Table-driven tests cover all edge cases\n- [x] Test case for unset protobuf field added\n\n- `sdk/go/pluginsdk/validation.go` - Validation functions and sentinel\n  errors for ProjectedCost and ActualCost requests\n\n- `sdk/go/pluginsdk/validation_test.go` - Comprehensive tests and\n  benchmarks for validation functions\n\n- `sdk/go/pluginsdk/validation.go`:\n  - Added package documentation explaining validation design philosophy\n  - Renamed `ErrProjectedCostResourceType` to `ErrProjectedCostResourceTypeEmpty`\n    for consistency with other string validation errors\n  - Clarified time range error message to explicitly state equal timestamps\n    are not allowed\n\n- `sdk/go/pluginsdk/validation_test.go`:\n  - Added test case for unset protobuf field\n  - Updated error reference to use renamed variable\n\n- `sdk/go/testing/contract.go` - Removed unused nolint directive,\n  updated `interface{}` to `any`\n\n- `sdk/go/testing/contract_test.go` - Added benchmark, updated loop\n  syntax to Go 1.22+ style\n\n- `GEMINI.md` - Fixed blank line around heading (MD022/MD032)\n- `specs/017-pluginsdk-validation/data-model.md` - Fixed blank lines\n  around headings and lists\n- `specs/017-pluginsdk-validation/plan.md` - Fixed line length, emphasis\n  style, and trailing newline\n- `specs/017-pluginsdk-validation/quickstart.md` - Fixed line length\n- `specs/017-pluginsdk-validation/research.md` - Fixed heading blank\n  lines, list formatting, trailing spaces, and indentation\n\n- `specs/017-pluginsdk-validation/tasks.md` - Marked all tasks complete\n\nCloses #130",
