          "distinct": true,
          "id": "a75b42b355395f590b7d211475de05f5083bd82b",
          "message": "feat(proto): add arn field to actual cost request (#160)\n\nAdd a dedicated `arn` field to `GetActualCostRequest` in `costsource.proto`\nto allow passing canonical cloud identifiers alongside the existing\n`resource_id`.\n\n- Add `string arn = 5` field to `GetActualCostRequest` message\n- Regenerate Go SDK with new `Arn` field and `GetArn()` method\n- Add `arn_test.go` with field validation and backward compatibility tests\n- Update `PLUGIN_DEVELOPER_GUIDE.md` with ARN field documentation\n\nCurrently, `GetActualCostRequest` only provides a single `resource_id` string.\nFor cloud provider plugins (specifically AWS Cost Explorer), we need the\ncanonical identifier (ARN) to robustly identify resources across services\nand contexts.\n\nThe new `arn` field allows the Core to pass:\n\n- `resource_id`: The identifier Pulumi uses for tracking\n- `arn`: The definitive, globally unique cloud identifier (AWS ARN, Azure\n  Resource ID, GCP Full Resource Name)\n\n- [x] `make test` passes - all SDK tests pass including new ARN tests\n- [x] `make lint-go` passes (0 issues)\n- [x] `buf lint` passes\n- [x] `buf breaking --against .git#branch=main` passes (backward compatible)\n\n- Non-breaking: Optional field with empty string default\n- Backward compatible: Existing clients work without modification\n\nCloses #157",
          "timestamp": "2025-12-14T21:02:34-06:00",
